sys_variable_value.value:
(function execute(inputs, outputs) {
   var myScript = new GetWheelsInfo();
    
    var driverIds = inputs.qlist
    // var driverIds = [
    //     "a2069de74766c2106a3eedf1d16d4368",
    //     "81ea516f47e6c2106a3eedf1d16d43cc",
    //     "f2aa75a747aac2106a3eedf1d16d432c",
    //     "f60b75a747aac2106a3eedf1d16d4349"
    // ];
    
    // Serialize the array into a JSON string
    var driverIdsJSON = JSON.stringify(driverIds);
    
    // Call the method and pass the serialized array
    var driversInfoJSON = myScript.getRacers(driverIdsJSON);
    
    // Deserialize the returned JSON string back into an array
    var driversInfo = JSON.parse(driversInfoJSON);
    
var ranks=[];
    
   for (var i = 0; i < driversInfo.length; i++) {
				ranks.push("# " + (i + 1) + ": " + driversInfo[i].model);
			}
			var val = ranks.join('\n');
			
    outputs.data = ( "Top Qualifiers :\n" + val);

})(inputs, outputs);

